DROP DATABASE IF EXISTS Emergency_Department;
CREATE DATABASE Emergency_Department;
USE Emergency_Department;

CREATE TABLE FAQs (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  question VARCHAR(100) NOT NULL UNIQUE CHECK (LENGTH(question) >= 15),
  answer TEXT NOT NULL
);

CREATE TABLE User_Roles (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name VARCHAR(25) UNIQUE NOT NULL CHECK (LENGTH(name) >= 5)
);

CREATE TABLE Users (
  person_number BIGINT NOT NULL PRIMARY KEY CHECK (person_number >= 0 AND person_number < POW(10, 11)),
  first_name VARCHAR(25) NOT NULL,
  last_name VARCHAR(25) NOT NULL,
  phone_number VARCHAR(25) NOT NULL UNIQUE CHECK (LENGTH(phone_number) >= 8),
  address VARCHAR(50) NOT NULL CHECK (LENGTH(address) >= 5),
  password VARCHAR(255) NOT NULL,
  created_date DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
  updated_date DATETIME NULL,
  user_role_id INT NOT NULL,
  FOREIGN KEY (user_role_id) REFERENCES User_Roles(id)
);

CREATE TABLE Inquiry_Statuses (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name VARCHAR(25) UNIQUE NOT NULL CHECK (LENGTH(name) >= 5)
);

CREATE TABLE Inquiries (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  title VARCHAR(100) NOT NULL CHECK (LENGTH(title) >= 15),
  description TEXT NOT NULL CHECK (LENGTH(description) >= 25),
  general_practitioner VARCHAR(50) NOT NULL CHECK (LENGTH(general_practitioner) >= 10),
  summary LONGTEXT NULL,
  received_date DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
  updated_date DATETIME NULL,
  patient_person_number BIGINT NULL,
  nurse_person_number BIGINT NULL,
  inquiry_status_id INT NOT NULL DEFAULT 1,
  FOREIGN KEY (patient_person_number) REFERENCES Users(person_number),
  FOREIGN KEY (nurse_person_number) REFERENCES Users(person_number),
  FOREIGN KEY (inquiry_status_id) REFERENCES Inquiry_Statuses(Id)
);

CREATE TABLE Inquiry_Images (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  url VARCHAR(255) NOT NULL CHECK (LENGTH(url) >= 10),
  inquiry_id INT NOT NULL,
  FOREIGN KEY (inquiry_id) REFERENCES Inquiries(id)
);

CREATE TABLE Chat_Messages (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  text LONGTEXT NULL,
  image_url VARCHAR(255) NULL CHECK (LENGTH(image_url) >= 10),
  received_date DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
  sender_person_number BIGINT NOT NULL,
  receiver_person_number BIGINT NOT NULL,
  inquiry_id INT NOT NULL,
  FOREIGN KEY (sender_person_number) REFERENCES Users(person_number),
  FOREIGN KEY (receiver_person_number) REFERENCES Users(person_number),
  FOREIGN KEY (inquiry_id) REFERENCES Inquiries(id)
);











