INSERT INTO FAQs VALUES (1, "Who should be tested for COVID-19?", "Anyone with a new respiratory infection or other symptoms of COVID-19, close contacts, or in the event of an outbreak with extended testing of other contacts, and anyone who suspects that they are infected with COVID-19");
INSERT INTO FAQs VALUES (2, "What are the symptoms of COVID-19?", "Fever, Reap, Heavy breath, Headache, Laxity, Impaired sense of smell and/or taste, Muscle aches, Sore throat, Runny or stuffy nose");
INSERT INTO FAQs VALUES (3, "What should you do while you wait for test results?", "The main rule is that you must stay at home until you get a test result, so that you avoid infecting others. The exception is if you have tested yourself if you have neither symptoms, have been exposed to infection, are in quarantine or suspect infection for other reasons. Then there is no need to stay at home waiting for test results. This could be, for example, if you have taken a test to be able to travel. Note that separate rules apply here for mutated viruses. Household members of close contacts in an outbreak associated with a case of the English or South African virus variant should stay at home until the close contact has tested negative by PCR test.");
INSERT INTO FAQs VALUES (4, "What kind of COVID-19 test is available at the Emergency Department?", "COVID-19 PCR Test: This test reveals whether you have an infection with COVID-19. In people infected with SARS-CoV-2, it will usually be possible to detect the genetic material of the virus in a sample from the upper respiratory tract (taken from the nose/throat) in the period from about 2 days before to 20 days after the onset of symptoms.");
INSERT INTO FAQs VALUES (5, "How is the test performed?", "Nose and throat test. We also use external laboratories for analyzing the PCR samples.");
